// import { createApp } from 'vue'
import { createStore } from 'vuex'
// import axios from "axios";

export default createStore({
    state () {
        return {
            cameras: []
        }
    },
    mutations: {
        
    },
    actions: {
        addToCameras({commit}, camera) {
            commit('setCameras', camera)
        }
    },
    getters: {
        getCameras(state) {
            return state.cameras
        }
    }
})
